import "../styles/About.css";
import imageTravel from "../imgs/travel.jpg";

const ourInfo = [
  {
    text: "",
    photoName: "",
  },
  {
    text: "Our very first tour was with a small group that combined breathtaking views with local hospility, and it was an unforgetful success.",
    photoName: imageTravel,
  },
];

function About() {
  return (
    <div>
      <header className="header-about">
        <h1>About Us</h1>
      </header>

      <div className="grid-2-cols-about">
        <p>
          Our Travel was established by 3 young travelers who shared one big
          dream: to help others experience the world in a more personal,
          exciting, and meaningful way. What started as a small idea between
          friends turned into a full-fledged travel agency fueled by curiosity,
          adventure, and love for connecting people to new cultures.
        </p>
        <div className="image-about">
          <img src={imageTravel} />
        </div>
      </div>
    </div>
  );
}

export default About;
